df = pd.read_csv('match_results.csv')

df = df[df["Result"] != "abandoned"]


# Convert the 'Time' column to datetime and extract the hour
df['Time'] = pd.to_datetime(df['Time'], utc=True)

# df = df[df["Time"] > "2023-09-01"]
# df = df[df["Time"] > "2023-06-01"]
# df = df[df["Time"] > "2023-01-01"]
df = df[(df["Time"] > "2023-01-01") & (df["Time"] <= "2023-06-01")]

import pytz
paris_tz = pytz.timezone('Europe/Paris')
df["Time"] = df['Time'].dt.tz_convert(paris_tz)


import holidays
fr_holidays = holidays.France()

df['Hour'] = df['Time'].dt.hour
# df['DayOfWeek'] = df['Time'].dt.dayofweek  # Monday=0, Sunday=6
def is_holiday_or_weekend(date):
    return date in fr_holidays or date.weekday() >= 5  # 5 and 6 are Saturday and Sunday

# df["DayOfWeek"] = df['Time'].apply(is_holiday_or_weekend)
df["OffWork"] = [date in fr_holidays or date.weekday() >= 5 for date in df["Time"]]

# Separate data into weekdays and weekends
# df_weekday = df[df['DayOfWeek'] < 5]  # Weekdays
# df_weekend = df[df['DayOfWeek'] >= 5]  # Weekends
df_weekday = df[~df['OffWork']]  # Weekdays
df_weekend = df[df['OffWork']]  # Weekends

# Count total matches per hour for weekdays and weekends
total_matches_weekday = df_weekday.groupby('Hour').size().reindex(range(24), fill_value=0)
total_matches_weekend = df_weekend.groupby('Hour').size().reindex(range(24), fill_value=0)

# Create a DataFrame to hold this data for plotting
plot_data = pd.DataFrame({
    'Weekday': total_matches_weekday,
    'Weekend': total_matches_weekend
})
# Re-calculating win rate for weekdays and weekends
win_rate_weekday = df_weekday[df_weekday['Result'] == 'won'].groupby('Hour').size().reindex(range(24), fill_value=0) / total_matches_weekday
win_rate_weekend = df_weekend[df_weekend['Result'] == 'won'].groupby('Hour').size().reindex(range(24), fill_value=0) / total_matches_weekend

# Creating a combined plot with dual axes
fig, ax1 = plt.subplots(figsize=(12, 6))

# Plot for Number of Games Played (Weekday and Weekend)
plot_data.plot(kind='bar', color=['skyblue', 'lightgreen'], ax=ax1)
ax1.set_xlabel('Hour of the Day')
ax1.set_ylabel('Number of Games')
ax1.tick_params(axis='y')
ax1.set_xticks(range(0, 24))
ax1.set_xticklabels([f"{hour}:00" for hour in range(24)], rotation=90)

# Instantiate a second axes that shares the same x-axis
ax2 = ax1.twinx()  
ax2.axhline(y=0.5, color='gray', linestyle='--')


# Plot for Win Rate (Weekday and Weekend)
ax2.plot(win_rate_weekday.index, win_rate_weekday, color='darkblue', marker='o', label='Win Rate - Weekday')
ax2.plot(win_rate_weekend.index, win_rate_weekend, color='darkgreen', marker='o', label='Win Rate - Weekend')
ax2.set_ylabel('Win Rate')
ax2.set_ylim(0, 1)  # Setting the limit for Win Rate axis
ax2.tick_params(axis='y')

# Adding a legend for win rates
ax2.legend(loc='upper left')

# Title and Layout
plt.title('Number of Games and Win Rate by Hour of the Day: Weekday vs Weekend')
fig.tight_layout()  # To adjust the layout
plt.show()
